    fn fill_the_db(db: &mut DB) -> (Vec<ContractAddress>, Vec<StateKey>) {
        let addresses = vec![b"first".sha256(), b"second".sha256(), b"third".sha256()];
        let mut stuff = vec![
            (DeltaKey { contract_address: addresses[2], key_type: State }, vec![8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8, 8]),
        ];

        let mut keys = Vec::with_capacity(addresses.len());
        for ((state, deltas, key), address) in encrypted_data().into_iter().zip(addresses.iter()) {
            let state = symmetric::encrypt(&state, &key).unwrap();
            stuff.push((DeltaKey { contract_address: *address, key_type: State}, state));
            for (j, delta) in deltas.into_iter().enumerate() {
                stuff.push((DeltaKey { contract_address: *address, key_type: Delta(j as u32)}, delta));
            }
            keys.push(key);
        }
        for (key, data) in stuff {
            db.force_update(&key, &data).unwrap();
        }

        (addresses, keys)
    }


